  //   for(i; i<5;i++){
  //     Hdikhara();
  //   }
  // }
  const Hdikhara = ()=>{

    document.querySelector('.Movie').style.display = 'none';
  }
  return (<>
    <h1 className = "tittle">Hello I am Harsh Bhatnagar</h1>
    <div className = "WholeSection">
    <div className = "leftmenu">
      <button onClick = {Hdikhara}>Movies</button>
    </div>
    <div className = "cards">
    {Cards.map((val,index)=>{
      return(
        <Navbar
          key = {index}
          images = {val.link}
          title = {val.title}
          date = {val.Date}
          btao = {val.what}
        />
      )
    })}

    </div>
    </div>
    </>
  );
}

export default App;
